import React from 'react'
import Picture from './danielescobar.jpg'

const ProfileSection = () => {
    return (
        <>
            <img className='object-contain  rounded-full mt-6 mx-1' src={Picture} alt="Logo" />
            <h1 className='text-white text-center text-3xl font-bold'>Daniel Escobar</h1>
            <h2 className='text-white text-center text-xl font-bold'>Software Engineer</h2>
            <h3 className='text-white text-center text-lg font-bold'>daniel.escobar5@udea.edu.co</h3>
            <h4 className='text-white text-center text-sm font-bold'>Software engineer with three years of experience as a monitor in the area of algorithms. 
            I am a person with easy adaptability to change, always willing to train and learn new topics and technologies in order to perform much better in my work.</h4>
        </>
    )
}

export { ProfileSection }
